import React from 'react'

const Contactlist = (props) => {
  console.log(id);
  const render = props.id.map((contact) =>{
    return(
      <div>
        {contact.name}

        {contact.email}

      </div>

    )
  })
  return (
    <div className="ui celled list">
      <h2>ContactList {render} </h2>
    </div>
  )
}

export default Contactlist
